import React from 'react'
export default function AddButton({id,handleIncrement,handleDecrement,currItemCount}) {

  return currItemCount === 0? (
    <button type="button" class="btn btn-primary" onClick={handleIncrement}>Add</button>
  ) : (
    <button type="button" class="btn btn-primary">
        <span onClick={handleIncrement} style={{paddingRight:'1px'}}>+</span>
        <span>{currItemCount}</span>
        <span onClick={handleDecrement} style={{paddingLeft:'1px'}}>-</span>
    </button>
  );
}
